    public async override Task<object> fetchBalance(object parameters = null)
    {
        /**
        * @method
        * @name ascendex#fetchBalance
        * @description query for balance and get the amount of funds available for trading or funds locked in orders
        * @param {object} params extra parameters specific to the ascendex api endpoint
        * @returns {object} a [balance structure]{@link https://docs.ccxt.com/en/latest/manual.html?#balance-structure}
        */
        parameters ??= new Dictionary<string, object>();
        await this.loadMarkets();
        await this.loadAccounts();
        object query = null;
        object marketType = null;
        var marketTypequeryVariable = this.handleMarketTypeAndParams("fetchBalance", null, parameters);
        marketType = ((List<object>)marketTypequeryVariable)[0];
        query = ((List<object>)marketTypequeryVariable)[1];
        object isMargin = this.safeValue(parameters, "margin", false);
        marketType = ((bool) isTrue(isMargin)) ? "margin" : marketType;
        parameters = this.omit(parameters, "margin");
        object options = this.safeValue(this.options, "fetchBalance", new Dictionary<string, object>() {});
        object accountsByType = this.safeValue(this.options, "accountsByType", new Dictionary<string, object>() {});
        object accountCategory = this.safeString(accountsByType, marketType, "cash");
        object account = this.safeValue(this.accounts, 0, new Dictionary<string, object>() {});
        object accountGroup = this.safeString(account, "id");
        object request = new Dictionary<string, object>() {
            { "account-group", accountGroup },
        };
        object defaultMethod = this.safeString(options, "method", "v1PrivateAccountCategoryGetBalance");
        object method = this.getSupportedMapping(marketType, new Dictionary<string, object>() {
            { "spot", defaultMethod },
            { "margin", defaultMethod },
            { "swap", "v2PrivateAccountGroupGetFuturesPosition" },
        });
        if (isTrue(isTrue((isEqual(accountCategory, "cash"))) || isTrue((isEqual(accountCategory, "margin")))))
        {
            ((Dictionary<string, object>)request)["account-category"] = accountCategory;
        }
        object response = await ((Task<object>)callDynamically(this, method, new object[] { this.extend(request, query) }));
        //
        // cash
        //
        //     {
        //         'code': 0,
        //         'data': [
        //             {
        //                 'asset': 'BCHSV',
        //                 'totalBalance': '64.298000048',
        //                 'availableBalance': '64.298000048',
        //             },
        //         ]
        //     }
        //
        // margin
        //
        //     {
        //         'code': 0,
        //         'data': [
        //             {
        //                 'asset': 'BCHSV',
        //                 'totalBalance': '64.298000048',
        //                 'availableBalance': '64.298000048',
        //                 'borrowed': '0',
        //                 'interest': '0',
        //             },
        //         ]
        //     }
        //
        // swap
        //
        //     {
        //         "code": 0,
        //         "data": {
        //             "accountId": "fut2ODPhGiY71Pl4vtXnOZ00ssgD7QGn",
        //             "ac": "FUTURES",
        //             "collaterals": [
        //                 {"asset":"ADA","balance":"0.355803","referencePrice":"1.05095","discountFactor":"0.9"},
        //                 {"asset":"USDT","balance":"0.000014519","referencePrice":"1","discountFactor":"1"}
        //             ],
        //         }j
        //     }
        //
        if (isTrue(isEqual(marketType, "swap")))
        {
            return this.parseSwapBalance(response);
        } else if (isTrue(isEqual(marketType, "margin")))
        {
            return this.parseMarginBalance(response);
        } else
        {
            return this.parseBalance(response);
        }
    }

