        object request = new Dictionary<string, object>() {};
        object market = null;
        if (isTrue(!isEqual(symbols, null)))
        {
            object symbol = this.safeValue(symbols, 0);
            market = this.market(symbol);
            object marketIds = this.marketIds(symbols);
            ((Dictionary<string, object>)request)["symbol"] = String.Join(",", ((List<object>)marketIds).ToArray());
        }
        object type = null;
        var typeparametersVariable = this.handleMarketTypeAndParams("fetchTickers", market, parameters);
        type = ((List<object>)typeparametersVariable)[0];
        parameters = ((List<object>)typeparametersVariable)[1];
        object response = null;
        if (isTrue(isEqual(type, "spot")))
        {
            response = await this.v1PublicGetTicker(this.extend(request, parameters));
        } else
        {
            response = await this.v2PublicGetFuturesTicker(this.extend(request, parameters));
        }
        //
        //     {
        //         "code":0,
        //         "data":[
        //             {
        //                 "symbol":"QTUM/BTC",
