    public async override Task<object> fetchOHLCV(object symbol, object timeframe = null, object since = null, object limit = null, object parameters = null)
    {
        /**
        * @method
        * @name ascendex#fetchOHLCV
        * @description fetches historical candlestick data containing the open, high, low, and close price, and the volume of a market
        * @param {string} symbol unified symbol of the market to fetch OHLCV data for
        * @param {string} timeframe the length of time each candle represents
        * @param {int|undefined} since timestamp in ms of the earliest candle to fetch
        * @param {int|undefined} limit the maximum amount of candles to fetch
        * @param {object} params extra parameters specific to the ascendex api endpoint
        * @returns {[[int]]} A list of candles ordered as timestamp, open, high, low, close, volume
        */
        timeframe ??= "1m";
        parameters ??= new Dictionary<string, object>();
        await this.loadMarkets();
        object market = this.market(symbol);
        object request = new Dictionary<string, object>() {
            { "symbol", getValue(market, "id") },
            { "interval", this.safeString(this.timeframes, timeframe, timeframe) },
        };
        // if since and limit are not specified
        // the exchange will return just 1 last candle by default
        object duration = this.parseTimeframe(timeframe);
        object options = this.safeValue(this.options, "fetchOHLCV", new Dictionary<string, object>() {});
        object defaultLimit = this.safeInteger(options, "limit", 500);
        if (isTrue(!isEqual(since, null)))
        {
            ((Dictionary<string, object>)request)["from"] = since;
            if (isTrue(isEqual(limit, null)))
            {
                limit = defaultLimit;
            } else
            {
                limit = mathMin(limit, defaultLimit);
            }
            ((Dictionary<string, object>)request)["to"] = this.sum(since, multiply(multiply(limit, duration), 1000), 1);
        } else if (isTrue(!isEqual(limit, null)))
        {
            ((Dictionary<string, object>)request)["n"] = limit; // max 500
        }
        object response = await this.v1PublicGetBarhist(this.extend(request, parameters));
        //
        //     {
        //         "code":0,
        //         "data":[
        //             {
        //                 "m":"bar",
        //                 "s":"BTC/USDT",
        //                 "data":{
        //                     "i":"1",
        //                     "ts":1590228000000,
        //                     "o":"9139.59",
        //                     "c":"9131.94",
        //                     "h":"9139.99",
        //                     "l":"9121.71",
        //                     "v":"25.20648"
        //                 }
        //             }
        //         ]
        //     }
        //
        object data = this.safeValue(response, "data", new List<object>() {});
        return this.parseOHLCVs(data, market, timeframe, since, limit);
    }

