        }
        object price = this.safeString(order, "price");
        object amount = this.safeString(order, "orderQty");
        object average = this.safeString(order, "avgPx");
        object filled = this.safeString2(order, "cumFilledQty", "cumQty");
        object id = this.safeString(order, "orderId");
        object clientOrderId = this.safeString(order, "id");
        if (isTrue(!isEqual(clientOrderId, null)))
        {
            if (isTrue(isLessThan(((string)clientOrderId).Length, 1)))
            {
                clientOrderId = null;
            }
        }
        object rawTypeLower = this.safeStringLower(order, "orderType");
        object type = rawTypeLower;
        if (isTrue(!isEqual(rawTypeLower, null)))
        {
            if (isTrue(isEqual(rawTypeLower, "stoplimit")))
            {
                type = "limit";
            }
            if (isTrue(isEqual(rawTypeLower, "stopmarket")))
            {
                type = "market";
            }
        }
        object side = this.safeStringLower(order, "side");
        object feeCost = this.safeNumber(order, "cumFee");
        object fee = null;
        if (isTrue(!isEqual(feeCost, null)))
        {
            object feeCurrencyId = this.safeString(order, "feeAsset");
            object feeCurrencyCode = this.safeCurrencyCode(feeCurrencyId);
            fee = new Dictionary<string, object>() {
                { "cost", feeCost },
                { "currency", feeCurrencyCode },
            };
        }
        object stopPrice = this.safeNumber(order, "stopPrice");
        object reduceOnly = null;
        object execInst = this.safeString(order, "execInst");
        if (isTrue(isEqual(execInst, "reduceOnly")))
        {
            reduceOnly = true;
        }
        object postOnly = null;
        if (isTrue(isEqual(execInst, "Post")))
        {
            postOnly = true;
        }
        return this.safeOrder(new Dictionary<string, object>() {
            { "info", order },
            { "id", id },
            { "clientOrderId", clientOrderId },
            { "timestamp", timestamp },
            { "datetime", this.iso8601(timestamp) },
            { "lastTradeTimestamp", lastTradeTimestamp },
            { "symbol", symbol },
            { "type", type },
            { "timeInForce", null },
            { "postOnly", postOnly },
            { "reduceOnly", reduceOnly },
            { "side", side },
            { "price", price },
            { "stopPrice", stopPrice },
            { "triggerPrice", stopPrice },
            { "amount", amount },
            { "cost", null },
            { "average", average },
            { "filled", filled },
            { "remaining", null },
            { "status", status },
            { "fee", fee },
            { "trades", null },
        }, market);
    }

    public async override Task<object> fetchTradingFees(object parameters = null)
    {
        /**
        * @method
        * @name ascendex#fetchTradingFees
        * @description fetch the trading fees for multiple markets
        * @param {object} params extra parameters specific to the ascendex api endpoint
        * @returns {object} a dictionary of [fee structures]{@link https://docs.ccxt.com/#/?id=fee-structure} indexed by market symbols
        */
        parameters ??= new Dictionary<string, object>();
        await this.loadMarkets();
        await this.loadAccounts();
        object account = this.safeValue(this.accounts, 0, new Dictionary<string, object>() {});
        object accountGroup = this.safeString(account, "id");
        object request = new Dictionary<string, object>() {
            { "account-group", accountGroup },
        };
        object response = await this.v1PrivateAccountGroupGetSpotFee(this.extend(request, parameters));
        //
        //      {
        //         code: '0',
        //         data: {
        //           domain: 'spot',
        //           userUID: 'U1479576458',
        //           vipLevel: '0',
        //           fees: [
        //             { symbol: 'HT/USDT', fee: { taker: '0.001', maker: '0.001' } },
        //             { symbol: 'LAMB/BTC', fee: { taker: '0.002', maker: '0.002' } },
        //             { symbol: 'STOS/USDT', fee: { taker: '0.002', maker: '0.002' } },
        //             ...
        //           ]
        //         }
        //      }
        //
        object data = this.safeValue(response, "data", new Dictionary<string, object>() {});
        object fees = this.safeValue(data, "fees", new List<object>() {});
        object result = new Dictionary<string, object>() {};
        for (object i = 0; isLessThan(i, getArrayLength(fees)); postFixIncrement(ref i))
        {
            object fee = getValue(fees, i);
            object marketId = this.safeString(fee, "symbol");
            object symbol = this.safeSymbol(marketId, null, "/");
            object takerMaker = this.safeValue(fee, "fee", new Dictionary<string, object>() {});
            ((Dictionary<string, object>)result)[(string)symbol] = new Dictionary<string, object>() {
                { "info", fee },
                { "symbol", symbol },
                { "maker", this.safeNumber(takerMaker, "maker") },
                { "taker", this.safeNumber(takerMaker, "taker") },
            };
        }
        return result;
    }

    public async override Task<object> createOrder(object symbol, object type, object side, object amount, object price = null, object parameters = null)
    {
        /**
        * @method
        * @name ascendex#createOrder
        * @description Create an order on the exchange
        * @param {string} symbol Unified CCXT market symbol
        * @param {string} type "limit" or "market"
        * @param {string} side "buy" or "sell"
        * @param {float} amount the amount of currency to trade
        * @param {float} price *ignored in "market" orders* the price at which the order is to be fullfilled at in units of the quote currency
        * @param {object} params Extra parameters specific to the exchange API endpoint
        * @param {string} params.timeInForce "GTC", "IOC", "FOK", or "PO"
        * @param {bool} params.postOnly true or false
        * @param {float} params.stopPrice The price at which a trigger order is triggered at
        * @returns [An order structure]{@link https://docs.ccxt.com/#/?id=order-structure}
        */
        parameters ??= new Dictionary<string, object>();
        await this.loadMarkets();
        await this.loadAccounts();
        object market = this.market(symbol);
        object marketType = null;
        var marketTypeparametersVariable = this.handleMarketTypeAndParams("createOrder", market, parameters);
        marketType = ((List<object>)marketTypeparametersVariable)[0];
        parameters = ((List<object>)marketTypeparametersVariable)[1];
        object options = this.safeValue(this.options, "createOrder", new Dictionary<string, object>() {});
        object accountsByType = this.safeValue(this.options, "accountsByType", new Dictionary<string, object>() {});
        object accountCategory = this.safeString(accountsByType, marketType, "cash");
        object account = this.safeValue(this.accounts, 0, new Dictionary<string, object>() {});
        object accountGroup = this.safeValue(account, "id");
        object clientOrderId = this.safeString2(parameters, "clientOrderId", "id");
        object request = new Dictionary<string, object>() {
            { "account-group", accountGroup },
            { "account-category", accountCategory },
            { "symbol", getValue(market, "id") },
            { "time", this.milliseconds() },
            { "orderQty", this.amountToPrecision(symbol, amount) },
            { "orderType", type },
            { "side", side },
        };
        object isMarketOrder = (isTrue((isEqual(type, "market"))) || isTrue((isEqual(type, "stop_market"))));
        object isLimitOrder = (isTrue((isEqual(type, "limit"))) || isTrue((isEqual(type, "stop_limit"))));
        object timeInForce = this.safeString(parameters, "timeInForce");
        object postOnly = this.isPostOnly(isMarketOrder, false, parameters);
        object reduceOnly = this.safeValue(parameters, "reduceOnly", false);
        object stopPrice = this.safeValue2(parameters, "triggerPrice", "stopPrice");
        parameters = this.omit(parameters, new List<object>() {"timeInForce", "postOnly", "reduceOnly", "stopPrice", "triggerPrice"});
        if (isTrue(reduceOnly))
        {
            if (isTrue(!isEqual(marketType, "swap")))
            {
                throw new InvalidOrder ((string)add(add(add(this.id, " createOrder() does not support reduceOnly for "), marketType), " orders, reduceOnly orders are supported for perpetuals only")) ;
            }
            ((Dictionary<string, object>)request)["execInst"] = "ReduceOnly";
        }
        if (isTrue(isLimitOrder))
        {
            ((Dictionary<string, object>)request)["orderPrice"] = this.priceToPrecision(symbol, price);
        }
        if (isTrue(isEqual(timeInForce, "IOC")))
        {
            ((Dictionary<string, object>)request)["timeInForce"] = "IOC";
        }
        if (isTrue(isEqual(timeInForce, "FOK")))
        {
            ((Dictionary<string, object>)request)["timeInForce"] = "FOK";
        }
        if (isTrue(postOnly))
        {
            ((Dictionary<string, object>)request)["postOnly"] = true;
        }
        if (isTrue(!isEqual(stopPrice, null)))
        {
            ((Dictionary<string, object>)request)["stopPrice"] = this.priceToPrecision(symbol, stopPrice);
            if (isTrue(isLimitOrder))
            {
                ((Dictionary<string, object>)request)["orderType"] = "stop_limit";
            } else if (isTrue(isMarketOrder))
            {
                ((Dictionary<string, object>)request)["orderType"] = "stop_market";
            }
        }
        if (isTrue(!isEqual(clientOrderId, null)))
        {
            ((Dictionary<string, object>)request)["id"] = clientOrderId;
        }
        object defaultMethod = this.safeString(options, "method", "v1PrivateAccountCategoryPostOrder");
        object method = this.getSupportedMapping(marketType, new Dictionary<string, object>() {
            { "spot", defaultMethod },
            { "margin", defaultMethod },
            { "swap", "v2PrivateAccountGroupPostFuturesOrder" },
        });
        if (isTrue(isEqual(method, "v1PrivateAccountCategoryPostOrder")))
        {
            if (isTrue(!isEqual(accountCategory, null)))
            {
                ((Dictionary<string, object>)request)["category"] = accountCategory;
            }
        } else
        {
            ((Dictionary<string, object>)request)["account-category"] = accountCategory;
        }
        object response = await ((Task<object>)callDynamically(this, method, new object[] { this.extend(request, parameters) }));
        //
        // spot
        //
        //      {
        //          "code":0,
        //          "data": {
        //              "accountId":"cshwT8RKojkT1HoaA5UdeimR2SrmHG2I",
        //              "ac":"CASH",
        //              "action":"place-order",
        //              "status":"Ack",
        //              "info": {
        //                  "symbol":"TRX/USDT",
        //                  "orderType":"StopLimit",
        //                  "timestamp":1654290662172,
        //                  "id":"",
        //                  "orderId":"a1812b6840ddU8191168955av0k6Eyhj"
        //              }
        //          }
        //      }
        //
        //
        // swap
        //
        //      {
        //          "code":0,
        //          "data": {
        //              "meta": {
        //                  "id":"",
        //                  "action":"place-order",
        //                  "respInst":"ACK"
        //              },
        //              "order": {
        //                  "ac":"FUTURES",
        //                  "accountId":"futwT8RKojkT1HoaA5UdeimR2SrmHG2I",
        //                  "time":1654290969965,
        //                  "orderId":"a1812b6cf322U8191168955oJamfTh7b",
        //                  "seqNum":-1,
        //                  "orderType":"StopLimit",
        //                  "execInst":"NULL_VAL",
        //                  "side":"Buy",
        //                  "symbol":"TRX-PERP",
        //                  "price":"0.083",
        //                  "orderQty":"1",
        //                  "stopPrice":"0.082",
        //                  "stopBy":"ref-px",
        //                  "status":"Ack",
        //                  "lastExecTime":1654290969965,
        //                  "lastQty":"0",
        //                  "lastPx":"0",
        //                  "avgFilledPx":"0",
        //                  "cumFilledQty":"0",
        //                  "fee":"0",
        //                  "cumFee":"0",
        //                  "feeAsset":"",
        //                  "errorCode":"",
        //                  "posStopLossPrice":"0",
        //                  "posStopLossTrigger":"market",
        //                  "posTakeProfitPrice":"0",
        //                  "posTakeProfitTrigger":"market",
        //                  "liquidityInd":"n"
        //              }
        //          }
        //      }
        //
        object data = this.safeValue(response, "data", new Dictionary<string, object>() {});
        object order = this.safeValue2(data, "order", "info", new Dictionary<string, object>() {});
        return this.parseOrder(order, market);
    }

