            { "hedged", null },
            { "timestamp", null },
            { "datetime", null },
            { "lastUpdateTimestamp", null },
            { "maintenanceMargin", null },
            { "maintenanceMarginPercentage", null },
            { "collateral", collateral },
            { "initialMargin", null },
            { "initialMarginPercentage", null },
            { "leverage", this.safeInteger(position, "leverage") },
            { "marginRatio", null },
        });
    }

